import './orders.css'
import React from 'react';

const Orders = () => {
  return (
    <div className='orders'>
        <h5>Orders</h5>
        <table>
            <tr>
                <th><input type={checkbox}></input></th>
                <th>Order ID</th>
                <th>Date</th>
                <th>Payment status</th>
                <th>Total</th>
                <th>Payment method</th>
                <th>Order status</th>
                <th>Acti</th>
            </tr>
        </table>
    </div>
  ) 
};

export default Orders;
